import React, {Component} from "react"

class ApplyComponent extends Component{
  render(){
    return(
      <div>
        <p className="text-24pt contact-title">
           Contact Us!
        </p>
        <p className="text-16pt" style={{textAlign:"center"}}>
           Explore our social media, submit a message, or send us an email.
        </p>
        <div style={{marginTop:"30px"}} className="blue-yellow-bar"/>

      </div>
    )
  }
}

export default ApplyComponent;
